import React, { useEffect, useState } from 'react';
import { getPets, patchPet, deletePet } from '../../services/pets';

const EditPet = () => {
    const [pets, setPets] = useState([]);
    const [editingPet, setEditingPet] = useState(null);
    const [formData, setFormData] = useState({
        name: '',
        age: '',
        breed: '',
    });
    const [isModalOpen, setIsModalOpen] = useState(false);

    useEffect(() => {
        const fetchPets = async () => {
            try {
                const petList = await getPets();
                setPets(Array.isArray(petList) ? petList : []);
            } catch (error) {
                console.error('Erro ao obter a lista de pets:', error);
            }
        };

        fetchPets();
    }, []);

    const handleEditPet = (pet) => {
        setEditingPet(pet);
        setFormData({
            name: pet.name,
            age: pet.age,
            breed: pet.breed,
        });
        setIsModalOpen(true);
    };

    const handleFormChange = (event) => {
        const { name, value } = event.target;
        setFormData((prevFormData) => ({
            ...prevFormData,
            [name]: value,
        }));
    };

    const handleCancelEdit = () => {
        setEditingPet(null);
        setFormData({
            name: '',
            age: '',
            breed: '',
        });
        setIsModalOpen(false);
    };

    const handleSaveEdit = async (values) => {
        try {
            await patchPet(editingPet.id, values);

            const updatedPets = await getPets();
            setPets(Array.isArray(updatedPets) ? updatedPets : []);
            setEditingPet(null);
            setFormData({}); // Limpa o formulário
            setIsModalOpen(false);
        } catch (error) {
            console.error('Erro ao atualizar o pet:', error);
        }
    };

    const handleDeletePet = async (pet) => {
        try {
            await deletePet(pet.id);

            const updatedPets = await getPets();
            setPets(Array.isArray(updatedPets) ? updatedPets : []);
        } catch (error) {
            console.error('Erro ao excluir o pet:', error);
        }
    };

    return (
        <div>
            <div className="h-full">
                <table>
                    <thead>
                    <tr>
                        <th>Nome</th>
                        <th>Idade</th>
                        <th>Raça</th>
                        <th>Ação</th>
                    </tr>
                    </thead>
                    <tbody>
                    {pets.map((pet) => (
                        <tr key={pet.id}>
                            <td>{pet.name}</td>
                            <td>{pet.age}</td>
                            <td>{pet.breed}</td>
                            <td>
                                <button onClick={() => handleEditPet(pet)}>Editar</button>
                                <button onClick={() => handleDeletePet(pet)}>Excluir</button>
                            </td>
                        </tr>
                    ))}
                    </tbody>
                </table>
            </div>
            {isModalOpen && (
                <div>
                    <h2>Editar Pet</h2>
                    <form onSubmit={() => handleSaveEdit(formData)}>
                        <div>
                            <label htmlFor="name">Nome do Pet</label>
                            <input
                                type="text"
                                id="name"
                                name="name"
                                value={formData.name}
                                onChange={handleFormChange}
                            />
                        </div>
                        <div>
                            <label htmlFor="age">Idade</label>
                            <input
                                type="text"
                                id="age"
                                name="age"
                                value={formData.age}
                                onChange={handleFormChange}
                            />
                        </div>
                        <div>
                            <label htmlFor="breed">Raça</label>
                            <input
                                type="text"
                                id="breed"
                                name="breed"
                                value={formData.breed}
                                onChange={handleFormChange}
                            />
                        </div>
                        <button type="submit">Salvar</button>
                        <button onClick={handleCancelEdit}>Cancelar</button>
                    </form>
                </div>
            )}
        </div>
    );
};

export default EditPet;
